a Dettagli singolo evento','Hide Event Total Seats Section from Single Event Details page'=>'Nascondi la sezione Posti totali dell\'evento dalla pagina Dettagli singolo evento','Hide Expired Event from Calendar'=>'Nascondi evento scaduto dal calendario','Hide Full Time Section from list'=>'Nascondi la sezione a tempo pieno dall\'elenco','Hide Left Sidebar Title'=>'Nascondi il titolo della barra laterale sinistra','Hide Location From Order Details & Email Section'=>'Nascondi la posizione dalla sezione Dettagli ordine ed e-mail','Hide Location Section from list'=>'Nascondi la sezione Posizione dall\'elenco','Hide Only End Time Section from list'=>'Nascondi solo la sezione Ora di fine dall\'elenco','Hide Organizer Section from list'=>'Nascondi la sezione Organizzatore dall\'elenco','Hide/Show Event Hover Book Now Button'=>'Nascondi/Mostra il pulsante Prenota ora al passaggio del mouse sull\'evento','hips'=>'fianchi','hire-a-helper'=>'assumere un aiutante','history'=>'storia','hockey-puck'=>'disco da hockey','home'=>'casa','home-1'=>'casa-1','hooli'=>'stronzo','Horizontal'=>'Orizzontale','hospital'=>'Ospedale','hospital-alt'=>'ospedale-alt','hospital-symbol'=>'simbolo dell\'ospedale','hotjar'=>'barattolo caldo','hourglass'=>'clessidra','hourglass-end'=>'estremità a clessidra','hourglass-half'=>'clessidra-metà','hourglass-start'=>'avvio a clessidra','Hours Style Settings'=>'Impostazioni di stile delle ore','house-silhouette'=>'silhouette di casa','houzz'=>'Houzz','How Can I configure Virtual Event?'=>'Come posso configurare un evento virtuale?','How can I Export attendee list as CSV?'=>'Come posso esportare l\'elenco dei partecipanti in formato CSV?','How can I see event wise registered attendee list?'=>'Come posso vedere l\'elenco dei partecipanti registrati all\'evento?','html5'=>'HTML5','http://mage-people.com'=>'http://mage-people.com','http://www.mage-people.com/'=>'http://www.mage-people.com/','hubspot'=>'hubspot','Hurry! Only %s %s tickets left'=>'Affrettati! Sono rimasti solo %s %s biglietti','I have configured correctly but pdf email I am not getting.'=>'Ho configurato correttamente ma non ricevo l\'email in formato PDF.','I installed event manager plugin but it does not work?'=>'Ho installato il plugin Event Manager ma non funziona?','i-cursor'=>'cursore i','Icon'=>'Icona','Icon Background Color'=>'Colore di sfondo dell\'icona','Icon Before Title'=>'Icona prima del titolo','Icon Color'=>'Colore dell\'icona','Icon Indicator'=>'Indicatore icona','Icon Library'=>'Libreria di icone','Icon Settings'=>'Impostazioni delle icone','Icon/class name....'=>'Nome dell\'icona/classe....','id-badge'=>'distintivo identificativo','id-card'=>'carta d\'identità','id-card-alt'=>'carta d\'identità-alt','If the icons are not working and you want to disable Font Awesome loading from the plugin, select Yes.'=>'Se le icone non funzionano e vuoi disattivare il caricamento di Font Awesome dal plugin, seleziona Sì.','If the icons are not working, and you want to remove Flat Icon load from the plugin, select "Yes."'=>'Se le icone non funzionano e vuoi rimuovere il caricamento Flat Icon dal plugin, seleziona "Sì".','If you enable this then a Widget area will be registred and you can add any widgets from the Widget Menu. By default its disabled'=>'Se abiliti questa opzione, verrà registrata un\'area widget e potrai aggiungere qualsiasi widget dal menu widget. Per impostazione predefinita, questa opzione è disabilitata.','If you encounter a Fatal Error message on the event details page, you can enable this patch and check if the error persists. However, if there is no error, we recommend keeping the patch disabled'=>'Se si verifica un messaggio di errore irreversibile nella pagina dei dettagli dell\'evento, è possibile abilitare questa patch e verificare se l\'errore persiste. Tuttavia, se non si verifica alcun errore, si consiglia di mantenere la patch disattivata.','If you encounter the message "Sorry, There Are No Seats Available" after updating to version 4.3.0 or later, you may enable this setting. Otherwise, please keep it unchanged.'=>'Se visualizzi il messaggio "Spiacenti, non ci sono posti disponibili" dopo l\'aggiornamento alla versione 4.3.0 o successiva, puoi abilitare questa impostazione. In caso contrario, mantienila invariata.','If you have saved organizer details, please select the "Organizer" option. Please note that if you select "Organizer" and have not checked the organizer from the Event Organizer list on the right sidebar, the Event Location section will not populate on the front end.'=>'Se hai salvato i dettagli dell\'organizzatore, seleziona l\'opzione "Organizzatore". Tieni presente che se selezioni "Organizzatore" e non hai selezionato l\'organizzatore dall\'elenco degli organizzatori dell\'evento nella barra laterale destra, la sezione "Luogo dell\'evento" non verrà visualizzata nel front-end.','If you reset this count, all booking information will be removed, including the attendee list. This action is irreversible, so please be sure before you proceed.'=>'Se azzeri questo conteggio, tutte le informazioni sulla prenotazione verranno rimosse, incluso l\'elenco dei partecipanti. Questa azione è irreversibile, quindi assicurati di averla verificata prima di procedere.','If you visit attendee list menu in event section then you will see all attendee list here. You can filter choosing event name and date if event is recurring event. After filtering right section there is 2 button to export attendee and extra service.'=>'Se visiti il menu "Elenco partecipanti" nella sezione "Eventi", vedrai l\'elenco completo dei partecipanti. Puoi filtrare scegliendo il nome e la data dell\'evento se è ricorrente. Dopo aver filtrato la sezione a destra, troverai due pulsanti per esportare i partecipanti e i servizi extra.','If you visit Event settings page then You will see PDF email tab top right, you can configure pdf email here.'=>'Se visiti la pagina delle impostazioni dell\'evento, vedrai la scheda E-mail PDF in alto a destra, dove puoi configurare l\'e-mail PDF.','If you want to display the ticket type list with an add-to-cart button on any post or page of your website, simply copy the shortcode and paste it where desired.'=>'Se vuoi visualizzare l\'elenco dei tipi di biglietto con un pulsante "Aggiungi al carrello" su qualsiasi post o pagina del tuo sito web, ti basta copiare lo shortcode e incollarlo dove preferisci.','If you want to enable event data available in the Rest API Please enable this.'=>'Se vuoi abilitare i dati degli eventi disponibili nell\'API REST, abilita questa opzione.','If you want to hide the expired event from the calendar please select Yes. Its applicable for the Free Calendar'=>'Se vuoi nascondere l\'evento scaduto dal calendario, seleziona Sì. È applicabile per il calendario gratuito','If you want to show the date and time in your local timezone, please select Yes.'=>'Se desideri visualizzare la data e l\'ora nel tuo fuso orario locale, seleziona Sì.','If you want to show the time zone with the date and time, please select "Yes".'=>'Se si desidera visualizzare il fuso orario con data e ora, selezionare "Sì".','If you want your event to be removed from the list once it is fully booked, you can select "Yes" here.'=>'Se desideri che il tuo evento venga rimosso dall\'elenco una volta esaurite le prenotazioni, puoi selezionare "Sì" qui.','If you would like to hide the location details from the order details section on the thank you page and confirmation email body, please choose "Yes". If you would like to show the location details, please choose "No". The default setting is "No".'=>'Se desideri nascondere i dettagli della sede dalla sezione dei dettagli dell\'ordine nella pagina di ringraziamento e nel corpo dell\'email di conferma, seleziona "Sì". Se desideri visualizzare i dettagli della sede, seleziona "No". L\'impostazione predefinita è "No".','If your event is online or virtual, please ensure that this option is enabled.'=>'Se il tuo evento è online o virtuale, assicurati che questa opzione sia abilitata.','If your event list page is loading slowly, you can select this option to improve performance. Keep in mind that selecting this option will disable Waitlist and Seat count features. '=>'Se la pagina dell\'elenco eventi si carica lentamente, puoi selezionare questa opzione per migliorare le prestazioni. Tieni presente che selezionando questa opzione verranno disattivate le funzioni Lista d\'attesa e Conteggio posti.','If your theme is not loading the Owl Carousel Library, or if you"re having issues with Owl Carousel, you can set this option to "Yes" to fix the issue.'=>'Se il tuo tema non carica la libreria Owl Carousel o se riscontri problemi con Owl Carousel, puoi impostare questa opzione su "Sì" per risolvere il problema.','Image'=>'Immagine','image'=>'immagine','image Indicator'=>'indicatore di immagine','Images'=>'Immagini','images'=>'immagini','imdb'=>'imdb','In Event Settings area we have slug changing option. You can change it and resave permalink to avoid 404 error.'=>'Nell\'area Impostazioni Evento abbiamo l\'opzione per cambiare lo slug. Puoi modificarlo e salvare nuovamente il permalink per evitare l\'errore 404.','In order to add a new tax class, please go to WooCommerce -> Settings -> Tax Area'=>'Per aggiungere una nuova classe di imposta, vai su WooCommerce -> Impostazioni -> Area Imposta','inbox'=>'posta in arrivo','indent'=>'rientro','industry'=>'industria','Infinite Loop'=>'Ciclo infinito','info'=>'informazioni','info-circle'=>'info-circle','Input Box'=>'Casella di input','Insert into '=>'Inserire in','Insert into Speaker'=>'Inserisci nell\'altoparlante','instagram'=>'Instagram','Install & Active Now'=>'Installa e attiva ora','internet-explorer'=>'Internet Explorer','Invalid product.'=>'Prodotto non valido.','ioxhost'=>'ioxhost','It uses WooCommerce to take payment, which provides freedom for using popular payment getaway via WooCommerce. This plugin supports all WordPress version and can be used to create any types of any types of events.'=>'Utilizza WooCommerce per accettare pagamenti, offrendoti la libertà di utilizzare il popolare sistema di pagamento tramite WooCommerce. Questo plugin supporta tutte le versioni di WordPress e può essere utilizzato per creare qualsiasi tipo di evento.','It will change the category slug for the entire plugin. Remember that after you change this slug, you need to flush permalinks. To do this, just go to <strong>Settings->Permalinks</strong> hit the Save Settings button.'=>'Cambierà lo slug della categoria per l\'intero plugin. Ricorda che dopo aver modificato questo slug, dovrai svuotare i permalink. Per farlo, vai su <strong>Impostazioni -> Permalink</strong> e clicca sul pulsante Salva impostazioni.','It will change the event post type label for the entire plugin.'=>'Cambierà l\'etichetta del tipo di post dell\'evento per l\'intero plugin.','It will change the event slug throughout the entire plugin. Remember, after changing this slug you need to flush permalinks. Just go to <strong>Settings->Permalinks</strong> hit the Save Settings button'=>'Cambierà lo slug dell\'evento in tutto il plugin. Ricorda, dopo aver modificato questo slug, devi svuotare i permalink. Vai su <strong>Impostazioni -> Permalink</strong> e premi il pulsante Salva impostazioni.','It will change the Events post type label on the entire plugin.'=>'Cambierà l\'etichetta del tipo di post Eventi sull\'intero plugin.','It will change the Events slug on the entire plugin. Remember after changing this slug you need to flush permalinks. Just go to Settings->Permalinks hit the Save Settings button'=>'Cambierà lo slug Eventi dell\'intero plugin. Ricorda che dopo aver modificato questo slug, devi svuotare i permalink. Vai su Impostazioni -> Permalink e premi il pulsante Salva impostazioni.','italic'=>'corsivo','itunes'=>'iTunes','itunes-note'=>'iTunes-note','java'=>'Giava','jenkins'=>'Jenkins','joget'=>'joget','joomla'=>'joomla','js'=>'js','